script: |
  super -f text -I q5443.spq | sort > q5443.out

inputs:
  - name: q5443.spq
    data: |
      SELECT 69 - 61 / col1 FROM tab0 (FORMAT parquet) WHERE NOT ( - + col0 ) BETWEEN 55 * col0 + ( - col1 ) AND ( + 83 );
  - name: tab0

outputs:
  - name: q5443.out
    data: |
      67
      69
      8
